import React, { FC, useEffect, useMemo, useState } from "react";
import {
  Button,
  Form,
  ImageUploader,
  ImageUploadItem,
  NavBar,
  Toast,
} from "antd-mobile";
import { MoreOutline } from "antd-mobile-icons";
import { RadioGroup, Input } from "@chatui/core";
import { postAnswer } from "../utils/api";

const options = [
  { label: "产品建议", value: "产品建议" },
  { label: "功能故障", value: "功能故障" },
  { label: "其他问题", value: "其他问题" },
];

interface IValue {
  radioI: string;
  inputI: string;
}
interface OhSuggestionProps {
  value?: IValue;
  onChange?: (value: any) => void;
}

const SuggestionContent: FC<OhSuggestionProps> = (props) => {
  const { value, onChange } = props;
  const [radioChecked, setRadioChecked] = useState(value?.radioI);
  const [inputValue, setInputValue] = useState(value?.inputI);

  useEffect(() => {
    onChange && onChange({ radioI: radioChecked, inputI: inputValue });
  }, [radioChecked, inputValue]);

  return (
    <React.Fragment>
      <RadioGroup
        value={radioChecked}
        options={options}
        onChange={(val: any) => setRadioChecked(val)}
      />
      <div style={{ width: "100%", height: "10px" }}></div>
      <Input
        rows={5}
        value={inputValue}
        maxLength={500}
        onChange={(val) => setInputValue(val)}
        placeholder="请输入问题描述"
      />
    </React.Fragment>
  );
};

const Suggestion: FC = () => {
  const right = (
    <div style={{ fontSize: 24 }}>
      <MoreOutline />
    </div>
  );

  const back = () =>
    Toast.show({
      content: "点击返回",
    });

  const [form] = Form.useForm();
  const [fileList, setFileList] = useState<ImageUploadItem[]>([]);

  const handleUpload = async (file: File) => {
    return {
      url: URL.createObjectURL(file),
    };
  };

  const saveSuggest = async (param: any) => {
    const res = await postAnswer(param);
    if (res) {
      Toast.show({ content: "反馈成功" });
      form.resetFields();
    }
  };
  const onSubmit = () => {
    const values = form.getFieldsValue();
    const param = {
      question: `${values.suggest.radioI}:${values.suggest.inputI}`,
      base64List: [
        "data:image/png;base64,",
      ],
    };
    saveSuggest(param);
  };

  return (
    <div className="suggestion-container">
      <NavBar backArrow={false}>意见反馈</NavBar>
      <Form
        form={form}
        footer={
          <Button
            block
            type="submit"
            color="primary"
            onClick={onSubmit}
            size="large"
          >
            提交
          </Button>
        }
      >
        <Form.Item
          name="suggest"
          label="反馈类型"
          required={true}
          rules={[{ required: true, message: "反馈类型和问题不能为空" }]}
        >
          <SuggestionContent />
        </Form.Item>
        <Form.Item label="图片或视频" name="photos">
          <ImageUploader
            value={fileList}
            onChange={setFileList}
            upload={handleUpload}
          />
        </Form.Item>
      </Form>
    </div>
  );
};

export default Suggestion;
